import React, { useState, useEffect } from 'react';

function ViewMyPackages() {
  const [packages, setPackages] = useState([]); // Stocăm pachetele
  const [error, setError] = useState(false);   // Stocăm starea erorii

  useEffect(() => {
    console.log("Fetching packages...");  // Log pentru a vedea când începe fetch-ul

    // Fetch către server pentru a obține lista de pachete
    fetch('http://localhost:8081/package/get-package') // Asigură-te că acest endpoint este corect
      .then((response) => {
        console.log("Response status:", response.status);  // Log pentru statusul răspunsului
        if (!response.ok) {
          throw new Error('Failed to fetch');
        }
        return response.json();
      })
      .then((data) => {
        console.log("Data received:", data);  // Log pentru datele primite de la backend
        setPackages(data);  // Setează starea cu datele primite
      })
      .catch((error) => {
        console.log("Fetch error:", error);  // Log pentru erorile de fetch
        setError(true);  // Setează starea de eroare
      });
  }, []); // Rulează doar la montarea componentei

  // În caz de eroare
  if (error) {
    return <p>Failed to fetch packages. Please try again later.</p>;
  }

  // Dacă nu sunt pachete
  if (packages.length === 0) {
    return <p>No packages available.</p>;
  }

  // Dacă sunt pachete disponibile
  return (
    <div>
      <h2>My Packages</h2>
      <ul>
        {console.log("Packages state:", packages)}  // Log pentru a verifica structura stării
        {packages.map((pkg) => (
          <li key={pkg.id}>  {/* Asigură-te că `pkg.id` este corect */}
            {pkg.name}  {/* Asigură-te că `pkg.name` este corect */}
          </li>
        ))}
      </ul>
    </div>
  );
}

export default ViewMyPackages;
